import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  Paper,
  Card,
  CardContent,
  CardActions,
  Button,
  Chip,
  IconButton,
  Menu,
  MenuItem,
  TextField,
  InputAdornment,
  Stack,
} from '@mui/material';
import {
  Search as SearchIcon,
  FilterList as FilterIcon,
  MoreVert as MoreVertIcon,
  LibraryBooks as LibraryIcon,
  Code as CodeIcon,
  Build as BuildIcon,
  Science as ScienceIcon,
  Handshake as HandshakeIcon,
} from '@mui/icons-material';
import { useSelector, useDispatch } from 'react-redux';
import { RootState } from '../../store';
import { resourceAPI } from '../../services/api';
import {
  fetchResourcesStart,
  fetchResourcesSuccess,
  fetchResourcesFailure,
} from '../../store/slices/resourceSlice';

interface Resource {
  _id: string;
  title: string;
  description: string;
  type: string;
  status: string;
  createdAt: string;
}

const ResourceLibrary: React.FC = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [filterAnchorEl, setFilterAnchorEl] = useState<null | HTMLElement>(null);
  const [selectedType, setSelectedType] = useState<string>('all');
  const [menuAnchorEl, setMenuAnchorEl] = useState<null | HTMLElement>(null);
  const dispatch = useDispatch();
  const { resources, loading } = useSelector((state: RootState) => state.resources);

  useEffect(() => {
    const fetchResources = async () => {
      dispatch(fetchResourcesStart());
      try {
        const response = await resourceAPI.getAll();
        dispatch(fetchResourcesSuccess(response.data));
      } catch (error) {
        dispatch(fetchResourcesFailure('Failed to fetch resources'));
      }
    };

    fetchResources();
  }, [dispatch]);

  const handleFilterClick = (event: React.MouseEvent<HTMLElement>) => {
    setFilterAnchorEl(event.currentTarget);
  };

  const handleFilterClose = () => {
    setFilterAnchorEl(null);
  };

  const handleTypeSelect = (type: string) => {
    setSelectedType(type);
    handleFilterClose();
  };

  const handleMenuClick = (event: React.MouseEvent<HTMLElement>) => {
    setMenuAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setMenuAnchorEl(null);
  };

  const filteredResources = resources.filter((resource: Resource) => {
    const matchesSearch = resource.title.toLowerCase().includes(searchQuery.toLowerCase()) ||
      resource.description.toLowerCase().includes(searchQuery.toLowerCase());
    const matchesType = selectedType === 'all' || resource.type === selectedType;
    return matchesSearch && matchesType;
  });

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Typography variant="h4" component="h1">
          Resource Library
        </Typography>
        <Button variant="contained" color="primary">
          Add Resource
        </Button>
      </Box>

      <Box sx={{ mb: 3, display: 'flex', gap: 2 }}>
        <TextField
          fullWidth
          variant="outlined"
          placeholder="Search resources..."
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <SearchIcon />
              </InputAdornment>
            ),
          }}
        />
        <Button
          variant="outlined"
          startIcon={<FilterIcon />}
          onClick={handleFilterClick}
        >
          Filter
        </Button>
      </Box>

      <Menu
        anchorEl={filterAnchorEl}
        open={Boolean(filterAnchorEl)}
        onClose={handleFilterClose}
      >
        <MenuItem onClick={() => handleTypeSelect('all')}>All Types</MenuItem>
        <MenuItem onClick={() => handleTypeSelect('document')}>Documents</MenuItem>
        <MenuItem onClick={() => handleTypeSelect('code')}>Code</MenuItem>
        <MenuItem onClick={() => handleTypeSelect('design')}>Design</MenuItem>
      </Menu>

      <Menu
        anchorEl={menuAnchorEl}
        open={Boolean(menuAnchorEl)}
        onClose={handleMenuClose}
      >
        <MenuItem onClick={handleMenuClose}>Edit</MenuItem>
        <MenuItem onClick={handleMenuClose}>Share</MenuItem>
        <MenuItem onClick={handleMenuClose} sx={{ color: 'error.main' }}>
          Delete
        </MenuItem>
      </Menu>

      <Box sx={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(300px, 1fr))', gap: 3 }}>
        {filteredResources.map((resource: Resource) => (
          <Card key={resource._id}>
            <CardContent>
              <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
                <Typography variant="h6" component="div" gutterBottom>
                  {resource.title}
                </Typography>
                <IconButton
                  size="small"
                  onClick={handleMenuClick}
                >
                  <MoreVertIcon />
                </IconButton>
              </Box>
              <Typography color="text.secondary" gutterBottom>
                {resource.description}
              </Typography>
              <Stack direction="row" spacing={1} sx={{ mt: 2 }}>
                <Chip label={resource.type} size="small" />
                <Chip label={resource.status} size="small" />
              </Stack>
            </CardContent>
            <CardActions>
              <Button size="small">View Details</Button>
              <Button size="small">Download</Button>
            </CardActions>
          </Card>
        ))}
      </Box>
    </Box>
  );
};

export default ResourceLibrary;
